jobInfo.postDescription:
岗位职责:
1.参与系统的调研和需求分析，做出总体设计、详细设计;
2.参与项目的开发工作，进行代码的实际编写;
3.能高质量的独立完成所负责的工作任务，并能对系统提出有效的优化建议;
4.能够按照项目要求编写相关产品文档;
5.能够快速融入团队，积极、有效的展开工作。
任职要求:
1.本科及以上学历，2年及以上工作经验;
2.Java 基础扎实，熟悉 Springboot、SpringMVC 等开源框架;
3.熟练掌握HTML、CSS、JavaScript、jQuery、Ajax等前台开发技术;
4.熟练掌握 Oracle、PostgreSQL 数据库，熟练掌握 PL/SQL 语言;
5.熟练使用 idea、Eclipse、MyEclipse 等开发工具;
6.熟练使用 Tomcat 服务器，熟练使用 SVN工具;
7.有医疗软件开发经验的优先;
